import React from "react";
import './style.css';

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar" href="/home">
        About
      </a>
      <a className="navbar" href="/contact">
        Contact
      </a>
      <a className="navbar" href="/projects">
        Projects
      </a>
      <a className="navbar" href="/projects">
        Add
      </a>
    </nav>
  );
}

export default Nav;
